insert into core.text_error_analysis_sentences(id, text_id, sentence_num, sentence) values('2c410676-4ea9-417b-8144-54e827ed9bf6'::UUID, core.get_text_id_by_full_code_or_title('C1 2017 II_001-167')::UUID, 9, 'Kõik see tähendab , et tagajärjed on üsna positiivsed .');
insert into core.text_error_analysis_sentences(id, text_id, sentence_num, sentence) values('9d104863-f6e0-4b84-9aa9-bee46071e268'::UUID, core.get_text_id_by_full_code_or_title('C1 2017 II_001-167')::UUID, 10, 'Teise päeva peateema oli " Tehnoloogia kiire areng kui kaugsuhtluse võimaldaja " .');
insert into core.text_error_analysis_sentences(id, text_id, sentence_num, sentence) values('2dd7f156-6407-41ee-a94c-b0b019bea1b4'::UUID, core.get_text_id_by_full_code_or_title('C1 2017 II_001-167')::UUID, 11, 'Enamik osalejatest oli nõus sellega , et tehnoloogiline areng on üldiselt positiivne nähtus ja suurepärane võimalus suhelda erinevate inimestega kogu maailmast .');
insert into core.text_error_analysis_sentences(id, text_id, sentence_num, sentence) values('c227b44e-4d43-4914-a643-3a1034199938'::UUID, core.get_text_id_by_full_code_or_title('C1 2017 II_001-167')::UUID, 12, 'Mida kiirem areneb tehnoloogia , seda rohkem võimalusi meil on suheldama ja infot vahetada .');
insert into core.text_error_analysis_sentences(id, text_id, sentence_num, sentence) values('89e93582-5f62-46c2-8df7-22791e07caa7'::UUID, core.get_text_id_by_full_code_or_title('C1 2017 II_001-167')::UUID, 13, 'Mõned külalised olid veendunud , et kuna tehnoloogia areneb nii kiiresti , see tõttu suhted ja suhtlemine muutuvad , ning see muutus ei ole igati positiivne .');
insert into core.text_error_analysis_sentences(id, text_id, sentence_num, sentence) values('3e2f3c1b-1363-4f66-bcb3-804e7795ee74'::UUID, core.get_text_id_by_full_code_or_title('C1 2017 II_001-167')::UUID, 14, 'On olemas andmed , et 80% meie suhtlemist koosneb mitteverbaalsest infost .');
insert into core.text_error_analysis_sentences(id, text_id, sentence_num, sentence) values('4b9c67d9-8407-4672-9d3c-ba34ac2c6929'::UUID, core.get_text_id_by_full_code_or_title('C1 2017 II_001-167')::UUID, 15, 'See tähendab , et kasutades erinevaid tehnoloogilisi võimalusi suhtlemiseks me ei saa kogu info kätte saada .');
insert into core.text_error_analysis_sentences(id, text_id, sentence_num, sentence) values('8e645b7f-8ba2-4106-8353-bc4125f52b2d'::UUID, core.get_text_id_by_full_code_or_title('C1 2017 II_001-167')::UUID, 16, 'Seepärast tehnoloogia ei ole ainult positiivne nähtus .');
insert into core.text_error_analysis_sentences(id, text_id, sentence_num, sentence) values('b53d48f7-7245-4391-b15c-0f4cc835aecd'::UUID, core.get_text_id_by_full_code_or_title('C1 2017 II_001-167')::UUID, 17, 'Üldiselt , võin öelda et niisugune konverents on väga kasulik .');
insert into core.text_error_analysis_sentences(id, text_id, sentence_num, sentence) values('ff443ba6-cd4a-4f78-b70c-abe80d8392b8'::UUID, core.get_text_id_by_full_code_or_title('C1 2017 II_001-167')::UUID, 18, 'Kõikidel oli võimalus oma arvamuse väljendamiseks , kompromissi leidmiseks .');
insert into core.text_error_analysis_sentences(id, text_id, sentence_num, sentence) values('16caa7c1-10bf-4426-ad37-ff4e77ccdade'::UUID, core.get_text_id_by_full_code_or_title('C1 2017 II_001-167')::UUID, 19, 'Kõige tähtsam seal oli vist see , et keegi ei kartnud oma arvamust väljendada ja kõik arvamused olid teretulnud .');
insert into core.text_error_analysis_sentences(id, text_id, sentence_num, sentence) values('dc28130e-b86f-403a-8cb0-c2bf4eaad049'::UUID, core.get_text_id_by_full_code_or_title('C1 2018 II_001-001')::UUID, 0, 'Tänapäeval kasutatakse arvuteid ja nutiseadmeid väga palju .');
insert into core.text_error_analysis_sentences(id, text_id, sentence_num, sentence) values('621c3fd4-65c3-4b42-853b-117f69bef80b'::UUID, core.get_text_id_by_full_code_or_title('C1 2018 II_001-001')::UUID, 1, 'Ilma nendeta on raske meie elu ette kujutada , sest need teevad meie elu lihtsamaks ning annavad võimalusi , mis ei olnud varem .');
