insert into core.text_error_analysis_sentences(id, text_id, sentence_num, sentence) values('057a0b2d-857d-4736-a211-4d200e2e33f3'::UUID, core.get_text_id_by_full_code_or_title('C1 2018 II_001-001')::UUID, 3, 'Nagu ma olen juba varem maininud , digipädevus on tõesti suur abistaja inimestele .');
insert into core.text_error_analysis_sentences(id, text_id, sentence_num, sentence) values('65fad271-00b0-4a48-bbf1-3e144727aaae'::UUID, core.get_text_id_by_full_code_or_title('C1 2018 II_001-001')::UUID, 4, 'Tänu sellele on võimalik vajalikku informatsiooni kiiresti üles leida või näiteks dokumendid üle kontrollida .');
insert into core.text_error_analysis_sentences(id, text_id, sentence_num, sentence) values('101335c3-1ea4-4b91-badd-06f319ae7641'::UUID, core.get_text_id_by_full_code_or_title('C1 2018 II_001-001')::UUID, 5, 'Digipädevus avab meie palju uusi võimalusi töö tegemisel .');
insert into core.text_error_analysis_sentences(id, text_id, sentence_num, sentence) values('f5fd0677-4632-43de-baa6-a21d4bc3e172'::UUID, core.get_text_id_by_full_code_or_title('C1 2018 II_001-001')::UUID, 6, 'See töö , mis varem võttis palju aega ning tehti käsitsi , on nüüd võimalik , kas arvuti või teise digiseadme abil , väga kiiresti ja mugavalt ära teha .');
insert into core.text_error_analysis_sentences(id, text_id, sentence_num, sentence) values('170440db-3626-49f0-8c02-c1ca4dc813d6'::UUID, core.get_text_id_by_full_code_or_title('C1 2018 II_001-001')::UUID, 7, 'Vaatamata sellele , et digiseadmed annavad eelduse , tuleb arvestada ka sellega , et nendel on turvariskid .');
insert into core.text_error_analysis_sentences(id, text_id, sentence_num, sentence) values('453b878f-d962-4eb0-bbc4-5ec58a8974a7'::UUID, core.get_text_id_by_full_code_or_title('C1 2018 II_001-001')::UUID, 8, 'Seminaril osalemine andis hea võimaluse kaasa mõelda ja oma arvamuse avaldada sellest , kuidas oma andmeid kaitsta ning turvariskidest hoiduda .');
insert into core.text_error_analysis_sentences(id, text_id, sentence_num, sentence) values('3e88fd80-eb7b-454b-b57b-34e69000ae50'::UUID, core.get_text_id_by_full_code_or_title('C1 2018 II_001-001')::UUID, 9, 'Nüüdisajal on loodud võimsad viirused , mis nakatavad meie digiseadmeid ja varastavad informatsiooni .');
insert into core.text_error_analysis_sentences(id, text_id, sentence_num, sentence) values('10051494-ca97-4672-852e-0d2106b35fed'::UUID, core.get_text_id_by_full_code_or_title('C1 2018 II_001-001')::UUID, 10, 'Selleks , et seda ei juhtuks , on vaja ettevaatlikult kahtlevaid lehekülge avada ning osta ka rakenduse , mis võiks kontrollida arvuti või teise nutiseadme seisundit .');
insert into core.text_error_analysis_sentences(id, text_id, sentence_num, sentence) values('c96c5daf-8d7e-475c-92ae-af22b8fbab70'::UUID, core.get_text_id_by_full_code_or_title('C1 2018 II_001-001')::UUID, 11, 'Seminarist osavõtmine meenutas seda , et digipädevus on meie riigi tugevam külg ning seda tuleb nutikalt ja targalt kasutada selleks , et saada veelgi suurema eelduse .');
insert into core.text_error_analysis_sentences(id, text_id, sentence_num, sentence) values('e9bc364e-a6b6-4d39-9098-a90f8b2c9e28'::UUID, core.get_text_id_by_full_code_or_title('C1 2018 II_001-001')::UUID, 12, 'Ainult meist sõltub , kuidas digipädevus edasi areneb ning millest kasu toob .');
insert into core.text_error_analysis_sentences(id, text_id, sentence_num, sentence) values('87a2d5c7-c70d-42e3-ae30-39de93604404'::UUID, core.get_text_id_by_full_code_or_title('C1 2018 III_003-047')::UUID, 0, 'Kodanikuühenduste konverentsil käsitleti sellised teemad , nagu seltsid ja ühingud kogukonna elu arendajatena ning vabatahtlik kaasamine .');
