insert into core.text_error_analysis_sentences(id, text_id, sentence_num, sentence) values('a7d121a2-3399-4d07-b626-ee9a595acd8c'::UUID, core.get_text_id_by_full_code_or_title('C1 2018 III_003-047')::UUID, 2, 'See võimaldab kodaniku tunnete arengut , lojaalsete kodanikete kasvatamist .');
insert into core.text_error_analysis_sentences(id, text_id, sentence_num, sentence) values('e87fec6d-63d2-4a28-a38e-2661db236067'::UUID, core.get_text_id_by_full_code_or_title('C1 2018 III_003-047')::UUID, 3, 'Kuidas siis teha nii , et rohkesti inimesi kuulusid kodanikuühendustele ning kuidas see aitab riiki arendada .');
insert into core.text_error_analysis_sentences(id, text_id, sentence_num, sentence) values('46f63c5b-b706-4351-9b3b-1c335740e8ac'::UUID, core.get_text_id_by_full_code_or_title('C1 2018 III_003-047')::UUID, 4, 'Esiteks , kui inimene külastab koosolekuid , kui ta võtab osa erinevatest üritustest , kui ta on mingi ühingu liige , kasvab tema suhete võrgustik , ta hakkab end turvalisem tunda .');
insert into core.text_error_analysis_sentences(id, text_id, sentence_num, sentence) values('f1794f93-b5e7-4281-a645-80e1485bb83e'::UUID, core.get_text_id_by_full_code_or_title('C1 2018 III_003-047')::UUID, 5, 'Samuti tekib tal huvi seltskondliku elu vastu .');
insert into core.text_error_analysis_sentences(id, text_id, sentence_num, sentence) values('9814f8d2-78de-4478-aec2-5cae54129e19'::UUID, core.get_text_id_by_full_code_or_title('C1 2018 III_003-047')::UUID, 6, 'Selle abil tunnevad inimesed rohkem huvi riigielu vastu , nad võtavad aktiivsed osa valimistest ja avaldavad oma arvamust .');
insert into core.text_error_analysis_sentences(id, text_id, sentence_num, sentence) values('21a6be39-b807-4e50-ad1b-ac36ce052206'::UUID, core.get_text_id_by_full_code_or_title('C1 2018 III_003-047')::UUID, 7, 'Tuleb tõsta kogukonna teadlikust ühenduste vallas ning teha nii , et võimalikult palju inimesi võisid leida endale mingisugune ühing , mille töö vastu nad tunneksid huvi .');
insert into core.text_error_analysis_sentences(id, text_id, sentence_num, sentence) values('5c2ecce6-e706-4a64-ae8f-4f05f0a67b94'::UUID, core.get_text_id_by_full_code_or_title('C1 2018 III_003-047')::UUID, 8, 'Teiseks , kogukonna elu arengule mõjutab hästi vabatahtlike kaasamine .');
insert into core.text_error_analysis_sentences(id, text_id, sentence_num, sentence) values('811c6945-e2bb-4678-9ec7-e9b71a42988a'::UUID, core.get_text_id_by_full_code_or_title('C1 2018 III_003-047')::UUID, 9, 'Kui kogukond on kultuurivaldkonna või heategevusega kaasatud , kasvab inimeste koostunne , tekivad uued tutvused ja sidemed .');
insert into core.text_error_analysis_sentences(id, text_id, sentence_num, sentence) values('326f1171-7263-4a13-b614-20b4eef9d52f'::UUID, core.get_text_id_by_full_code_or_title('C1 2018 III_003-047')::UUID, 10, 'Arvatakse , et kui inimene on oma eluga rahul , kui ta tegeleb millega , mis talle meeldib , siis ei teki tal soovi oma elukohast lahkuda , kuna ta teab , et on raske parema kohta eluks leida .');
insert into core.text_error_analysis_sentences(id, text_id, sentence_num, sentence) values('a9a7b8cd-29d4-4c6c-b14a-a5d7bd7e370a'::UUID, core.get_text_id_by_full_code_or_title('C1 2018 III_003-047')::UUID, 11, 'Lisaks sellele , on teada , et igasugune koostöö teeb kogukonna tugevaks .');
insert into core.text_error_analysis_sentences(id, text_id, sentence_num, sentence) values('d7d818bf-0772-447a-b35f-6adb069569ef'::UUID, core.get_text_id_by_full_code_or_title('C1 2018 III_003-047')::UUID, 12, 'Sellega kasvavad inimeste turvalisuse- ja rahutunned');
insert into core.text_error_analysis_sentences(id, text_id, sentence_num, sentence) values('a71da596-9b78-4f53-bba7-4bed75f63daf'::UUID, core.get_text_id_by_full_code_or_title('C1 2018 III_003-047')::UUID, 13, 'Lõpuks on vaja öelda , et erinevad ühingud , seltsid ja erinevates valdkondades tööd kasvatavad lojaalseid kodanikke .');
insert into core.text_error_analysis_sentences(id, text_id, sentence_num, sentence) values('efc92bbe-a86a-41c3-af9f-5a89dbcfd71f'::UUID, core.get_text_id_by_full_code_or_title('C1 2018 III_003-047')::UUID, 14, 'Seega kasvab riigiga rahulolek , tugevdavad inimsuhted .');
insert into core.text_error_analysis_sentences(id, text_id, sentence_num, sentence) values('774f0d85-9e3f-473f-ab3a-ae9daad05bf8'::UUID, core.get_text_id_by_full_code_or_title('C1 2018 III_003-047')::UUID, 15, 'Mida rohkem on inimestel võimalusi kokku saada ja suhelda omavahel , seda aktiivsemad kodanikud nad on .');
insert into core.text_error_analysis_sentences(id, text_id, sentence_num, sentence) values('73fda203-132d-4a5a-8117-4f5e21356f24'::UUID, core.get_text_id_by_full_code_or_title('C1 2018 III_003-047')::UUID, 16, 'Tuleb vaeva nägema selleks , et võimalikult paljud inimesid kuulusid ühendustele ja võtsid osa kas või loodushoiust või päästetöödest - või teise riigielu valdkonnast .');
insert into core.text_error_analysis_sentences(id, text_id, sentence_num, sentence) values('31ae7c44-0d5c-4e7a-bbe4-51b6caa32f96'::UUID, core.get_text_id_by_full_code_or_title('C1 2018 IV_001-009')::UUID, 0, 'Lugupeetud kuulajad !');
