insert into core.text_error_analysis_sentences(id, text_id, sentence_num, sentence) values('6cb29a7d-569c-4ce5-928b-b6f199ee6692'::UUID, core.get_text_id_by_full_code_or_title('C1 2018 IV_001-009')::UUID, 3, 'Üks esile tõstetud teemadeks oli " Kohaliku omavalitsuse võimalused ja viisid tervise eest hoolitsemisel " .');
insert into core.text_error_analysis_sentences(id, text_id, sentence_num, sentence) values('4e7c04c5-520d-424d-a8c8-7950cd6251ab'::UUID, core.get_text_id_by_full_code_or_title('C1 2018 IV_001-009')::UUID, 4, 'See tekitas palju arutelu ning konverentsi osavõtjad tulid otsusele , et kohalik omavalitsus peaks kõigepealt looma võimalusi tervislikuks eluviisiks .');
insert into core.text_error_analysis_sentences(id, text_id, sentence_num, sentence) values('4e4e33c7-b32e-4b96-8123-5d5a74e95017'::UUID, core.get_text_id_by_full_code_or_title('C1 2018 IV_001-009')::UUID, 5, 'Ma olen selle arvamusega täiesti nõus .');
