insert into core.text_error_analysis_sentences(id, text_id, sentence_num, sentence) values('c4a7644b-8ee8-4cea-9133-b9b51e856626'::UUID, core.get_text_id_by_full_code_or_title('C1 2018 IV_001-009')::UUID, 8, 'Teiseks käsitletud teemaks oli " Töötervishoiuarsti juures läbiviidava kohustusliku tervisekontrolli olulisus " .');
