insert into core.text_error_analysis_sentences(id, text_id, sentence_num, sentence) values('7d8de28c-00cf-4605-9e7e-eabd90ece33d'::UUID, core.get_text_id_by_full_code_or_title('C1 2018 IV_001-009')::UUID, 10, 'Mulle tundub see väide õigena , kuna ilma tervisekontrollita ei ole võimalik haigusi varem avastada .');
insert into core.text_error_analysis_sentences(id, text_id, sentence_num, sentence) values('d6a5e046-1ee4-41e6-a30c-3b6701376a31'::UUID, core.get_text_id_by_full_code_or_title('C1 2018 IV_001-009')::UUID, 11, 'Tihti juhtub nii , et inimesel endal pole küll kaebusi , aga haigus on juba sees .');
insert into core.text_error_analysis_sentences(id, text_id, sentence_num, sentence) values('091dca4b-0ea6-4ef5-9193-33aed08b282a'::UUID, core.get_text_id_by_full_code_or_title('C1 2018 IV_001-009')::UUID, 12, 'Tervisekontroll aitab haigust avastada ning ravimist varem alustada .');
