insert into core.text_error_analysis_sentences(id, text_id, sentence_num, sentence) values('c99e31eb-b02e-48a7-be66-92142ba04d86'::UUID, core.get_text_id_by_full_code_or_title('C1 2018 IV_001-009')::UUID, 14, 'Kokkuvõtteks tahan öelda , et konverentsil käsitletud teemad on praeguseks ajaks aktuaalsed ja vajavad tähelepanu .');
