insert into core.text_error_analysis_sentences(id, text_id, sentence_num, sentence) values('1627f5f0-b095-4eaa-9ee7-c500ffd9e33d'::UUID, core.get_text_id_by_full_code_or_title('C1 2017 I_001-068')::UUID, 4, 'Sügisel , alates 1. septembrist kasvab liiklusõnnetusete arv , kus ohvriks langevad just koolilapsed , kes ei pea kinni elementaarsetest reeglites sõiduteed ületades .');
