insert into core.text_error_analysis_sentences(id, text_id, sentence_num, sentence) values('bcbae41f-892f-42b7-ad68-514b81de141c'::UUID, core.get_text_id_by_full_code_or_title('C1 2017 I_001-068')::UUID, 8, 'Nagu oli näha väljatoodud andmetest ja statistikast , Päästeamet loodab koostööle erinevate organisatsioonidega , mis aitaksid kaasa õnnetuste vältimisel .');
