insert into core.text_error_analysis_sentences(id, text_id, sentence_num, sentence) values('2e0290a7-2b2d-4ffe-b277-8952373ed46e'::UUID, core.get_text_id_by_full_code_or_title('C1 2017 I_001-068')::UUID, 10, 'Selle päeva motoks võib välja kuulutada " Inimeste elu on tema endi kätes "');
